Из года в год на протяжений 5 лет...
Начиная с конца лета и до ноября в мою жизнь приходят кардинальные события..
Обычно они ( поворачивают) мою голову в другом направлении ..
События обычно разного характера но с хорошей встряской..
Меняется личная жизнь, работа, в этот раз меняюсь и я ..
Сейчас я хотела просто описать события которые происходили со мной на протяжении 5 лет в одно и тоже время , но пока писала то задалась вопросом «что произошло 5 лет назад?» .Когда был этот «первый координатный поворот»?
Я вспомнила..
5 лет назад , в конце августа , я принимала одно из самых важных решений в своей жизни..
Я плакала , плакала часами на пролёт и каждый день молила Бога о лучшей судьбе для себя..
Это был правда переломный момент моей жизни..
Сейчас я не могу сказать что события тех дней были всего лишь «мелочью» не могу сказать что тогда было все просто а я себя накручивала..
Тогда жизнь, стала совершено другой..
(я не знаю как могло быть иначе , и безумно счастлива что все так ).Обдумав те события , на данный момент я понимаю почему «перелом» повторяется из года в год 🤥
Ведь каждый год в этот период вселенная посылает мне возможность изменить свою жизнь, возможность о которой я так просила 🙏
.
